import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Login from './Pages/Login';

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Routes>
            <Route exact path='/' component={Login} />,
            <Route exact path='/login' component={Login} />,
          </Routes>
        </div>

      </Router>
    </div>
  );
}


export default App;
